import Navbar from './Navbar'
import Form from './Form'
import { useState } from 'react';
import Raoutpage from './Raoutpage';


function App() {

  const [page,setpage]=useState(1)

  const handleButton = ()=>{
    setpage(page+1)
  }

  return (
    <div>

      <Navbar/>
      <Form/>
      <Raoutpage/>
    </div>
  );
}

export default App;
